  \"2016-07-27T22:41:42.646759\",\n\t\"name\": \"assessment-of-contamination-in-caves-located-at-the-ozark-plateau-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Ozark Plateau National Wildlife Refuge
  (Refuge) is located in east central Oklahoma; a sizeable portion of the Refuge is
  also located along Spavinaw Creek, near the headwaters of Lake Eucha. Recent studies
  concluded that Lake Eucha was receiving high concentrations of phosphorus and nitrate
  in surface and ground water, respectively. The scientific objective of this study
  is to expand the database of contaminants present in the aquatic habitats of the
  Ozark Plateau National Wildlife Refuge.  This database includes information on concentrations
  of heavy metals and organochlorines in groundwater and sediment, and in bats and
  food sources collected from designated caves and riparian areas within the Refuge.
  Based on the data in this study, there appears to be slight organic and inorganic
  contamination of the cave habitats which were assessed, including groundwater flowing
  through the caves.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
